Kimberly Alexis Bledel (born September 16, 1981) is an American actress and former fashion model. She is known for her role in the television series Gilmore Girls and for the films Tuck Everlasting, Sin City, and The Sisterhood of the Traveling Pants. She goes by her first name of &quot;Kimberly&quot; with family and friends, but is known professionally as Alexis Bledel.
